  true,\n\t\"url\": null,\n\t\"notes\": \"This is the Reformatted Annotated Level
  1A product for the CCD science data. The data numbers (DN) have been commuted from
  12-bit numbers to 16-bit byte aligned half-words. (Suggested Usage: MISR L1B1 (radiance
  conversion) processing needs the MISR CCD science data which has been formatted
  as 16-bit,byte-aligned and linearly encoded values derived from the raw MISR LO
  CCD science data.The data represents all 9 cameras & 4 spectral bands collected
  during routine science observations of the sunlit portion of the Earth.A two bit
  data quality indicator,generated during standard processing,is stored in the least
  significant bits of each digital number (DN).)\",\n\t\"license_title\": \"U.S. Government
